description:
Ethnographic work of art by Bambara people;  The Ch-wara headcrest is a symbol spring, rebirth and an excellent harvest.  A chimera representing a combination of Antelope, Aardvark and Pangolin, the Chi-Wara headcrest is a beautifully sculptural object.  From the 1920&#x27;s 30s, this pairs geometric rhythm suggest the art deco influence of early modernity.  Both headcrests are stably set into metal pedestals, one in steel and the other in solid bronze.  

Bronze Base: 46&quot; x 10.5&quot; x 4&quot;

Steel Base: 39&quot; x 12&quot; x 4&quot;
